import React from 'react';

const LoginPage = () => {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h2>Login / Sign Up</h2>
            <form>
                <input type="email" placeholder="Email" style={{ margin: '10px', padding: '10px' }} /><br />
                <input type="password" placeholder="Password" style={{ margin: '10px', padding: '10px' }} /><br />
                <button type="submit" style={{ padding: '10px 20px', backgroundColor: '#004085', color: '#fff' }}>Submit</button>
            </form>
        </div>
    );
};

export default LoginPage;
